import React, { Component } from 'react'
import MediaPlayer from '../MediaPlayer/Media-Player'


class Results extends Component {
    constructor() {
        super();
        this.state = {

        }
    }

    handleClick = (args) => {
        console.log(args)
    }

    render() {

        // if (this.props.response) {
        //     for (let i = 0; i < this.props.response.items.length; i++) {
        //         console.log(this.props.response.items[i].snippet.title)
        //         console.log(this.props.response.items[i].id.videoId)

        //     }
        // }

        let renObjData = []

        if (this.props.response) {
            renObjData = this.props.response.items.map(function (data, idx) {
                return ([
                    <li key={idx} onClick={() => this.handleClick(idx)}>{data.snippet.title}</li>,
                ]);
            });
        }


        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[1].id.videoId}
                    />
                </div>}
                <div className="Result_List">
                    <ul>
                        {renObjData}
                    </ul>
                </div>

            </div>
        )
    }

}

export default Results
